import React from 'react';
import File from './file/File';
import { useSelector } from 'react-redux';

const FileList = () => {
    // const files = useSelector(state => state.files.files).map(file => <File file={file} key={file.id} />);
    const files = [
        {id: 1, name: 'dir_1', type: 'dir', size: '5gb', date: '25.06.2021'},
        {id: 2, name: 'dir_2', type: 'file', size: '10gb', date: '26.06.2002'}
        ].map(file => <File file={file} key={file.id} />);
    return (
        <div className='FileList-container'>
            <div className='FileList-header'>
                <span className='FileList-name'>Name</span>
                <span className='FileList-date'>Date</span>
                <span className='FileList-size'>Size</span>
            </div>
            {files}
        </div>
    );
};

export default FileList;
